import './App.css'

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h1> Simplest Working Calculator</h1>
      </header>
      <input type="number"/>
      <div className="buttons">
        <button> add </button>
        <button> subtract </button>
        <button> multiply </button>
        <button> divide </button>
        <button> reset input </button>
        <button> reset result </button>
        </div>
    </div>
  );
}


export default App;
